class i{constructor(){this.main()}async main(){for(;;)this.updateVideoFrames(),await this.sleep(1e3)}sleep(t){return new Promise(e=>setTimeout(e,t))}updateVideoFrames(){Array.from(document.getElementsByTagName("video")).forEach(e=>{e.removeAttribute("disablepictureinpicture"),e.removeAttribute("preload")})}}new i;
